import './App.css';
import Header from './components /Header';
import PokemonInfo from './components /pokemonInfo';
import Navbar from './components /Navbar';
import Footer from './components /Footer';


function App() {
  return (
    <div> 
      <div>
        <Header/>
      </div>

      <div>
        <Navbar/>
      </div>

      <div>
        <PokemonInfo/>
      </div>

      <div>
        <Footer/>
      </div>

    </div>


  )
}

export default App;
